import "./App.css";
import { useState } from "react";
import { link } from "fs";





function App() {



const [item, setItem] = new useState({});
const [temp, setTemp] = new useState();

function update() {
  setItem( {temp , ...item} );
}

function updatetemp(e) {
  setTemp(e.target.value);
}

const render = item.map( (i)=> {<li>i</li>} )



  return (
    <div className="App">
      <div className="card">
        <div className="title">
          <h1>TO DO LIST </h1>
        </div>

        <div className="additem">
          <input
            className="input"
            type="text"
            placeholder="Add items from here"
            onChange={updatetemp}
            value={item}
          />
          <button onClick={update}> + </button>
        </div>

        <div className="list">
          <ol>
            {render}
          </ol>
        </div>

        <div> hello </div>
      </div>
    </div>
  );
}
export default App;
